insert  into `manage_bid`(`id`,`title`,`department_id`,`img`,`file`,`status`,`gmt_create`,`gmt_modified`,`description`) values ('1478669356026105858','呼和浩特石化公司2022年度计量器具校准服务项目','2','/static/preview.jpg','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/ef16e4ab4a6e48f4979cfa550ffc25f1service_oss.zip','Finally','2022-01-05 18:07:01','2022-01-06 11:54:38','<p><a name=\"_Toc505956379\"></a>1. 招标条件</p>\n<p><a name=\"_Toc505958106\"></a><a name=\"_Toc505956381\"></a><a name=\"_Toc505780466\"></a><a name=\"_Toc76652712\"></a><a name=\"_Toc505780465\"></a><a name=\"_Toc505958105\"></a><a name=\"_Toc505956380\"></a>本招标项目呼和浩特石化公司2022年度计量器具校准服务项目已完成审批，招标人为<a name=\"_Hlk71644818\"></a>中国石油天然气股份有限公司呼和浩特石化分公司，具备招标条件，现对其进行公开招标。</p>\n<p><a name=\"_Toc91512979\"></a>2. 项目概况与招标范围</p>\n<p>2.1 项目概况：本项目为中国石油呼和浩特石化公司计量器具校准服务项目。该项目主要包括呼和浩特石化公司石油产品分析类仪器设备、环保分析类仪器设备、计量检定校准配套仪器设备、温度压力类仪器设备及信号仪表类仪器设备的校准服务。</p>\n<p>2.2 招标范围：本次招标<a name=\"_Toc76652713\"></a>435台件的计量器具校准，详见下表。</p>\n<p>2.3、服务期限：自合同签订之日-2022年12月31日。</p>\n<p>2.4、服务地点：</p>\n<p>①外送校准计量器具为投标方校准实验室内；</p>\n<p>②下场校准计量器具为中国石油呼和浩特石化公司内。</p>\n<p><a name=\"_Hlk65762158\"></a>2.5、最高限价：19.74万元（含税）（提供本项目服务过程产生的全部费用）。</p>\n<p>2.6、其他要求：</p>\n<p>①如待校准计量器具有相对应的现行有效的国家、地方、行业检定规程、校准规范，参照相应检定规程或校准规范开展校准服务，同时根据招标方需求另行开展有证标物校准服务；</p>\n<p>②如待校准计量器具没有相对应的现行有效的国家、地方、行业检定规程、校准规范，则参照计量器具对应的实验方法使用有证标物开展校准服务；</p>\n<p>③如待校准计量器具既没有相对应的现行有效的国家、地方、行业检定规程、校准规范，也没有相对应的有证标物，则参照计量器具对应的实验方法，选取其中有现行有效的国家、地方、行业检定规程、校准规范的关键控制条件开展校准服务（如温度、压力、转速、力值等）；</p>\n<p>④校准过程中所需的试剂、有证标物需中标方自行准备。</p>\n<p>2.7主要技术要求或技术方案：</p>\n<p>主要技术要求为使用现行有效的国家、地方、行业检定规程、校准规范开展校准服务。</p>\n<p><a name=\"_Toc91512980\"></a>3. 投标人资格要求</p>\n<p>3.1 本次招标不接受联合体投标。</p>\n<p>3.2 资质条件：</p>\n<p>①在中华人民共和国境内注册，依法取得营业执照且营业执照在有效期内；</p>\n<p>②投标人应取得中国合格评定国家认可委员会实验室认可证书（CNAS证书）或检验检测机构资质认定证书（CMA证书）；</p>\n<p>③投标人应承诺可以校准招标范围中不少于80种计量器具（需提供承诺书）。</p>\n<p>3.3 业绩要求：近三年内（2019年1月1日至公告截止之日）开展过人民币十万元及以上金额同类项目业绩（提供合同及对应发票）。&nbsp;&nbsp;&nbsp;</p>\n<p>3.4信誉要求：<a name=\"_Toc76652714\"></a><a name=\"_Toc505958108\"></a><a name=\"_Toc505956383\"></a></p>\n<p>①没有处于被责令停业，财产被接管，冻结或破产状态，以及投标人的供应商资格没有被中石油暂停、冻结、中止、终止等情况；</p>\n<p>②投标人被工商行政管理机关在全国企业信用信息公示系统中列入严重违法失信企业名单或被最高人民法院在&ldquo;信用中国&rdquo;网站（www.creditchina.gov.cn）列入失信被执行人名单的不得参加此次投标；</p>\n<p>③中国石油集团公司失信行为相关管理规定：暂停投标资格：失信分达到8分时，暂停投标人的投标资格半年；失信分达到9分时，暂停投标人的投标资格一年；失信分达到10分暂停投标人的投标资格两年。暂停期满后恢复投标资格，有效期内的失信分继续加分或扣分。取消投标人资格：失信分10.5分及以上，或在暂停期间再次发生失信行为的，取消集团公司范围内的投标资格三年。期满重新获得投标人资格的，失信分不清零，有效期顺延三年。（评委现场查询）。</p>\n<p>4. 招标文件的获取</p>\n<p><a name=\"_Toc76652715\"></a><a name=\"_Toc505958109\"></a><a name=\"_Toc505956384\"></a>4.1凡有意参加投标的潜在投标人，请于2022年01月05日至2022年01月11日17时，登录 中国石油电子招标投标交易平台下载电子招标文件。</p>\n<p>①登录<u>&ldquo;中国石油招标投标网&rdquo;</u>，进入中国石油电子招标投标平台在线报名，如未在中国石油电子招标投标平台上注册过的潜在投标人需要先注册并通过平台审核，审核通过后登录平台在&ldquo;可报名项目&rdquo;中可找到本项目并完成在线报名。</p>\n<p>②办理本项目标书费缴纳事宜。本次招标文件采取电汇购买后，电子招标投标交易平台下载文件的发售方式。潜在投标人须在报名截止日前完成在线报名并将银行汇款底单，收款、开票信息承诺书（<strong>盖章扫描版和excel电子版均需提交，</strong>格式详见公告附件1）发送至招标代理机构联系人电子邮箱（应与招标代理机构联系人确认），否则视为报名不成功，电汇款到达指定账号的次日，招标代理机构工作人员在电子招标平台解锁，潜在投标人自行下载招标文件。<strong>缴费账号详见公告第7条规定的账号</strong>，<strong>不接受个人转账</strong>。</p>\n<p>③此次采购招标项目为全流程网上操作，投标人需要使用中国石油电子招标投标平台的U-key才能完成投标工作，因此要求所有参与本次采购招标的投标人必须办理U-key（具体操作请参考中国石油招标投标网首页----操作指南---《关于招标平台U-KEY办理和信息注册维护通知》）。其他具体操作请参考中国石油招标投标网操作指南中&ldquo;投标人用户手册&rdquo;的相关章节，有关注册、报名等交易平台的操作问题也可咨询技术支持团队相关人员，<strong>咨询电话:4008800114</strong>。</p>\n<p>4.2招标文件每套售价为&nbsp;<u>&nbsp;&nbsp;500&nbsp;&nbsp;</u>元人民币，请有意参加投标的潜在投标人确认自身资格条件是否满足要求，售后不退，应自负其责。<strong>如不满足开标条件需第二次报名时，请投标人务必自行登录中国石油电子招标投标交易平台报名，否则视为放弃投标。</strong></p>\n<p>4.3本次招标文件采取线上发售的方式。潜在投标人在4.1规定的时间内完成4.1规定的2项工作后，招标机构工作人员将在网上解锁，潜在投标人可登录中国石油电子招标投标平台下载招标文件。</p>\n<p><a name=\"_Toc91512981\"></a>5.<a name=\"_Toc505780468\"></a>&nbsp;投标文件的递交</p>\n<p><a name=\"_Toc91512982\"></a><a name=\"_Toc76652716\"></a><a name=\"_Toc505958110\"></a><a name=\"_Toc505780469\"></a><a name=\"_Toc505956385\"></a>（一）本次招标采取网上递交电子投标文件的投标方式</p>\n<p>1.网上电子投标文件递交：</p>\n<p>投标人应在5.2规定的投标截止时间前通过&ldquo;中国石油电子招标投标平台&rdquo;递交电子投标文件；（为避免受网速及网站技术支持工作时间的影响，建议于投标截止时间前24小时完成网上电子投标文件的递交。）投标截止时间前未被系统成功传送的电子投标文件将不被接受，视为主动撤回投标文件。</p>\n<p>2.现场电子投标文件递交:</p>\n<p>①电子版投标文件递交时间：2022年02月10日08时30分（北京时间）。</p>\n<p>②电子版投标文件递交地点：中国石油电子招标投标平台。</p>\n<p>（二）投标截止时间及开标时间（网上开标）：2022年02月10日08时30分（北京时间）。</p>\n<p>（三）开标地点（网上开标）：中国石油电子招标投标平台（所有投标人可登录中国石油电子招标投标平台在线参加开标仪式）。</p>\n<p>（四）潜在投标人应在投标截止时间前，向本公告第八条规定的账号提交<u>&nbsp;3900</u>元人民币的投标保证金，缴纳方式为 银行汇款且必须从投标人基本账户转出。</p>\n<p>6. 发布公告的媒介</p>\n<p><a name=\"_Toc76652717\"></a><a name=\"_Toc505958111\"></a><a name=\"_Toc505780470\"></a><a name=\"_Toc505956386\"></a>6.1中石油招标投标网：www.cnpcbidding.com</p>\n<p>6.2电子交易平台（外网）：https://ebidmanage.cnpcbidding.com</p>\n<p>6.3电子交易平台（内网）：<a href=\"https://ebidmanage.cnpcbidding.cnpc/\">https://ebidmanage.cnpcbidding.cnpc</a></p>\n<p>本公告如有修改和补充也在以上网站同时公布。</p>\n<p><a name=\"_Toc91512983\"></a>7. 联系方式&nbsp;&nbsp;&nbsp;</p>\n<p>招标人：中国石油天然气股份有限公司呼和浩特石化分公司</p>\n<p>招标代理机构：天津大港油田工程咨询有限公司</p>\n<p>地&nbsp; 址： 天津滨海新区大港油田创业三路 &nbsp;&nbsp;&nbsp;邮编： &nbsp;&nbsp;&nbsp;&nbsp;300280&nbsp;&nbsp;&nbsp;</p>\n<p>联系人： 舒涛&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;邮箱：&nbsp;<a href=\"mailto:534501247@qq.com\">534501247@qq.com</a></p>\n<p>电&nbsp; 话： 022-25967303&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;手机： 18526672585&nbsp;&nbsp;</p>\n<p>账户名称：天津大港油田工程咨询有限公司</p>\n<p>开户银行：中国建设银行天津油田支行</p>\n<p>账&nbsp;&nbsp;&nbsp; 号：12001765001052508570</p>\n<p>异议受理部门：大港油田招标中心&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 联系电话：022-25916838</p>\n<p>意见与建议：大港油田招标中心&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 联系电话：18630970271</p>\n<p>&nbsp;</p>\n<p>电子招标运维单位：中油物采信息技术有限公司</p>\n<p>电子投标技术咨询电话：4008800114语音导航&ldquo;电子招标&rdquo;</p>\n<p>注册咨询电话：010-62069351、 62069370</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>天津大港油田工程咨询有限公司</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2022年01月</p>'),('1478669863599804418','抚顺石化公司循环水场水剂框架招标采购项目','3','/static/preview.jpg','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/1baedcc4341f435480469812d55a42a4service_oss.zip','Finally','2022-01-05 18:09:03','2022-01-07 17:38:01','<p><strong>一、招标条件</strong></p>\n<p>&nbsp;&nbsp;&nbsp; 本招标项目 抚顺石化公司循环水场水剂采购（一、二标段）已按要求履行了相关报批及备案等手续，资金（资金来源）已落实，具备招标条件，现进行公开招标。</p>\n<p><strong>二、项目概况与招标范围</strong></p>\n<p>2.1招标项目概况：</p>\n<p><strong>一标段（化工单元）：</strong>烯烃厂第一循环水场、第二循环水场、乙烯南水场、乙烯北水场、腈纶厂循环水场、合洗厂乙氧基化装置循环水场、合洗厂BOPP循环水场、热电厂新厂循环水场、热电厂老厂循环水场需用药剂和服务进行招标采购。</p>\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td>\n<p>单元</p>\n</td>\n<td>\n<p>标段</p>\n</td>\n<td>\n<p>单位</p>\n</td>\n<td>\n<p>循环水场名称</p>\n</td>\n<td>\n<p>额定循环量t/h</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"8\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>化工单元</p>\n</td>\n<td rowspan=\"8\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>一标段</p>\n</td>\n<td rowspan=\"2\">\n<p>&nbsp;</p>\n<p>烯烃厂</p>\n</td>\n<td>\n<p>第一循环水场</p>\n</td>\n<td>\n<p>60000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>第二循环水场</p>\n</td>\n<td>\n<p>45000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>乙烯化工厂</p>\n</td>\n<td>\n<p>南、北水场</p>\n</td>\n<td>\n<p>20000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>腈纶厂</p>\n</td>\n<td>\n<p>腈纶循环水场</p>\n</td>\n<td>\n<p>14500</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"2\">\n<p>&nbsp;</p>\n<p>合洗厂</p>\n</td>\n<td>\n<p>乙氧循环水场</p>\n</td>\n<td>\n<p>1550</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>BOPP循环水场</p>\n</td>\n<td>\n<p>1000</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"2\">\n<p>&nbsp;</p>\n<p>热电厂</p>\n</td>\n<td>\n<p>新热电水场</p>\n</td>\n<td>\n<p>32000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>热电水场</p>\n</td>\n<td>\n<p>10000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>合计</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>184050</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><strong>二标段（炼油单元）：</strong>石油二厂南循环水场、石油二厂北循环水场、石油二厂空压站循环水场、石油二厂燃料气水场、石油三厂循环水场、洗化厂循环水场、催化剂厂循环水场，需用药剂和现场服务进行招标采购。</p>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td>\n<p>　</p>\n</td>\n<td>\n<p>　</p>\n</td>\n<td>\n<p>单位</p>\n</td>\n<td>\n<p>循环水场名称</p>\n</td>\n<td>\n<p>额定循环量t/h</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"10\">\n<p>炼油单元</p>\n</td>\n<td rowspan=\"10\">\n<p>二标段</p>\n</td>\n<td rowspan=\"4\">\n<p>石油二厂</p>\n</td>\n<td>\n<p>南循环水场</p>\n</td>\n<td>\n<p>17500</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>空压站水场</p>\n</td>\n<td>\n<p>1600</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>北循环水场</p>\n</td>\n<td>\n<p>33000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>燃料气水场</p>\n</td>\n<td>\n<p>200</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"2\">\n<p>石油三厂</p>\n</td>\n<td>\n<p>中心水场</p>\n</td>\n<td>\n<p>3000</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>芳烃水场</p>\n</td>\n<td>\n<p>4000</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"2\">\n<p>洗化厂</p>\n</td>\n<td>\n<p>界区循环水场</p>\n</td>\n<td>\n<p>3500</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>空分循环水场</p>\n</td>\n<td>\n<p>2500</p>\n</td>\n</tr>\n<tr>\n<td rowspan=\"2\">\n<p>催化剂厂</p>\n</td>\n<td>\n<p>催化剂循环水场</p>\n</td>\n<td>\n<p>270</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>催化剂厂动力车间循环水场</p>\n</td>\n<td>\n<p>400</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>合计</p>\n</td>\n<td>\n<p>　</p>\n</td>\n<td>\n<p>　</p>\n</td>\n<td>\n<p>　</p>\n</td>\n<td>\n<p>65970</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>2.2 招标范围：</p>\n<p>1、本次招标期限两年（从合同正式生效日期起计算），按买方生产实际情况供货。</p>\n<p>2、分两个标段（化工单元和练油单元）进行招标，其中一标段（化工单元）额定循环水量为184050吨/小时，二标段（练油单元）额定循环水量为65970吨/小时。</p>\n<p><strong>所有投标人均可以同时投标一标段和二标段，一二标段同时开标。一标段先进行评标，一标段中标单位，取消其二标段中标资格。若一标段流标，二标段中标单位取消其一标段中标资格。</strong></p>\n<p>3、药剂投加要求具体如下：</p>\n<p><strong>3.1</strong><strong>一标段</strong></p>\n<p>1）<strong>各循环水场清洗、杀菌剥离为一年两次提报。</strong>无论何种原因（包括不明介质泄露等异常情况），造成水场水质恶化，水处理服务商必须无偿、无条件提供异常处理药剂及服务（包括提供清洗、剥离、预膜药剂及服务、换热器拆解后垢样的采集以及分析，并提供有针对性的处理方案）。</p>\n<p>2）所有循环水场非氧化性杀菌剂需采用两种以上，<strong>在正常状态非氧化杀菌剂投加要求每月投加不少于2次， 6-9月每月投加不少于4次。</strong></p>\n<p>3）除正常使用的氧化性杀菌剂外，<strong>所有循环水场要有应急的氧化性杀菌剂（保证药剂投加的连续性）。</strong></p>\n<p><strong>4</strong><strong>）烯烃厂第一循环水场、第二循环水场、乙烯南水场、乙烯北水场投标剂种循环水投标剂种采用无磷（膦）药剂。</strong></p>\n<p><strong>5</strong><strong>）烯烃厂第二循环水场投标剂种不许有季铵盐、十二烷基苯磺酸钠等表面活性剂药类药剂；乙烯南水场、乙烯北水场只允许在杀菌剥离时使用含有季铵盐、十二烷基苯磺酸钠等表面活性剂药类药剂。</strong></p>\n<p>6）硫酸由甲方提供。</p>\n<p>7）现场所用药剂全部由乙方提供，包括（次氯酸钠）等通用药剂。</p>\n<p>8）乙烯化工厂氧化性杀菌剂暂时采用液氯杀菌（甲方提供），若改用次氯酸钠则由乙方提供。</p>\n<p>9）其中产生的报价风险由乙方负责。</p>\n<p>10）根据装置日常次氯酸钠和液氯的消耗量统计，在满足微生物控制效果以及保证余氯的情况下，投标方案中各厂所用次氯酸钠的标准和年消耗量不得低于表中所列。</p>\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\n<tbody>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>杀菌剂名称及标准</p>\n</td>\n<td>\n<p>次氯酸钠年消耗量（吨）</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>烯烃厂一循</p>\n</td>\n<td rowspan=\"2\">\n<p>次氯酸钠&nbsp;&nbsp; 有效氯含量10%</p>\n</td>\n<td>\n<p>600</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>烯烃厂二循</p>\n</td>\n<td>\n<p>400</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>乙烯厂南、北水场</p>\n</td>\n<td>\n<p>液氯 氯含量99.6%（按1:10的比例换算成10%次氯酸钠的用量）</p>\n</td>\n<td>\n<p>480</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>腈纶厂</p>\n</td>\n<td>\n<p>次氯酸钠&nbsp;&nbsp; 有效氯含量10%</p>\n</td>\n<td>\n<p>220</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>热电厂</p>\n</td>\n<td>\n<p>次氯酸钠&nbsp;&nbsp; 有效氯含量10%</p>\n</td>\n<td>\n<p>200</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>合洗厂</p>\n</td>\n<td>\n<p>次氯酸钠&nbsp;&nbsp; 有效氯含量10%</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>合计</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>1900</p>\n</td>\n</tr>\n</tbody>\n</table>\n<div>&nbsp;</div>\n<p>&nbsp;</p>\n<p><strong>3.2</strong><strong>二标段</strong></p>\n<p>3.2.1石油二厂南循环水场、石油二厂北循环水场、石油二厂空压站循环水场、、燃料气水场药剂投加要求（填写要求详见第七项）具体如下：</p>\n<p>1）石油二厂南循环水场、石油二厂北循环水场每两个月一次清洗剥离，每年六次异常处理，投标人投标药剂及服务费用应充分考虑此条件。</p>\n<p>2）非氧化性杀菌剂不少于2种，且不能为同一系列，交替投加。非氧化杀菌剂投加要求，每月投加不少于1次， 夏季6-9月每月投加不少于2次。</p>\n<p>3）氧化性杀菌剂两种以上，其中一种为次氯酸钠，根据现场实际情况次氯酸钠用量南水场和空压站水场年用量不能低于700吨，北循环水场年用量不能低于1300吨。石油二厂南循环水场、石油二厂北循环水场、石油二厂空压站循环水场，氧化性杀菌剂两种以上，因现场投加条件限制，氧化性杀菌剂不考虑氯气，粉末或固体氯类杀菌剂不能在厂区现场储存。</p>\n<p>4）现场所用药剂全部由乙方提供，包括（次氯酸钠）等通用药剂。</p>\n<p>3.2.2 石油三厂、洗化厂、催化剂厂循环水场药剂投加要求为无磷配方</p>\n<p>3.2.3 石油三厂、洗化厂、催化剂厂循环水场药剂投加要求（填写要求详见第七项）具体如下：</p>\n<p>1）各循环水场清洗、剥离频次为一年两次。正常状态非氧化杀菌剂投加要求，每月投加不少于2次， 6-9月每月投加不少于4次。</p>\n<p>2）非氧化性杀菌剂需采用两种以上的杀菌剂。</p>\n<p>3）洗化厂循环水场不能有表面活性剂药类，水处理过程中（包括异常处理）不产生泡沫类物质。</p>\n<p>4、本次招标是打包采购（药剂费用和现场服务费用），投标人应充分考虑水场生产波动和停工检修风险，在此期间垢样采集、分析、清洗预膜等药剂及服务费用均由中标人自行承担。</p>\n<p>5、投标人必须提供自家生产的各种药剂（通用产品除外），中标后投标人按要求在运行周期内根据生产实际需要随时供货，产品质量达不到要求时，招标人有权拒收。包装物由卖方自行回收。</p>\n<p>6、招标人按照《抚顺石化公司循环水场达标考核管理规定》考核标准严格按月考核，如在承包期内连续两次或半年内累计三次水场不达标，招标人有权终止商务合同。</p>\n<p>7、结算方式：每季度按实际处理量（以厂计量核定循环水实际流量为准，对于旁滤在供水侧要加上旁滤流量）结算，以各厂投标报价进行结算。若实际用量大于投标时吨水处理单耗，超出部分不予结算。</p>\n<p>2.3技术要求：详见招标文件第六章。</p>\n<p>2.4交货期：本次招标期限近二年（从合同正式生效日期起计算），按买方生产实际情况供货。</p>\n<p>2.5交货地点：抚顺石化公司各循环水场现场。</p>\n<p><strong>三、投标人资格条件</strong></p>\n<p>1、具备独立法人资格。</p>\n<p>2、<strong>一标段（化工单元）：</strong>在国内中石油、中石化和中海油化工行业循环水场（要求单套循环处理量&ge;30000m3/h），具有近五年内两家及以上正常运行一年的业绩（业绩需提供采购合同和加盖业绩单位公章的现场技术服务报告以及联系人和联系方式,现场服务报告要注明单套循环水场处理能力，同一个业绩多套循环水场循环量不能累加计算）。</p>\n<p><strong>二标段（炼油单元）：</strong>在国内中石油、中石化、中海油炼油行业单套循环水场处理能力&ge;20000m3/h，具有近五年内两家及以上正常运行一年的业绩（业绩需提供采购合同和加盖业绩单位公章的现场技术服务报告以及联系人和联系方式,现场服务报告要注明单套循环水场处理能力，同一个业绩多套循环水场循环量不能累加计算）。</p>\n<p>3、投标人应具有生产循环水药剂的合法资质，每种投标药剂（通用产品除外）都必须取得中石油集团公司油化剂产品质量认证，并在有效期内。</p>\n<p>4、<strong>一标段（化工单元）：</strong>烯烃厂第一循环水场、第二循环水场、乙烯南水场、乙烯北水场投标剂种循环水投标剂种采用无磷（膦）药剂。</p>\n<p><strong>二标段（炼油单元）：</strong>石油三厂、洗化厂、催化剂厂循环水场药剂投加要求为无磷配方。</p>\n<p>5、近五年在集团、公司任何一次抽样检查中无不合格项。</p>\n<p>6、只允许制造商投标。</p>\n<p>7、不接受联合体投标。</p>\n<p>8、列入抚顺石化公司&ldquo;黑名单&rdquo;或者在中油能源一号网显示&ldquo;终止&rdquo;状态的供货商不具有投标资格。</p>\n<p>9、除央企及其所属单位之外，投标人法定代表人、负责人、股东、主要人员相同的或存在管理、控股关系的不同单位，不得同时参加本项目同一标段投标或者未划分标段的同一项目投标。（须提供天眼查<a href=\"http://www.tianyancha.com/\">www.tianyancha.com</a>中股东和主要人员信息截图）</p>\n<p><strong>注：招标人将根据招标文件资格审查的规定，采用资格后审方式对投标人进行资格审查。</strong></p>\n<p><strong>四、招标文件的获取</strong></p>\n<p>4.1 有意参加投标者，请于2022年01月06日08:00:00时至2022年01月18日23:59:59时招标文件发售截止时间前登陆中国石油招标投标网<strong>（<a href=\"http://www.cnpcbidding.com/\">http://www.cnpcbidding.com</a>）</strong>招投标平台，或中国石油电子招标投标交易平台<strong>（https://ebidmanage.cnpcbidding.com/bidder/ebid/base/login.html）</strong>报名购买招标文件。</p>\n<p>4.2、招标文件售价<strong>450&nbsp;</strong>元人民币/标段(售后不退）。</p>\n<p>4.3、潜在投标人用已注册账号登陆中国石油电子招标投标交易平台，选择本项目报名并购买招标文件。首次参与投标用户须在中国石油电子招投标电子交易平台注册企业账号，办理CA证书（U-KEY）。</p>\n<p>本项目为全流程电子招标项目，投标人须使用U-KEY才能完成投标工作，因此要求参与本项目所有投标人必须办理U-KEY。中国石油电子招标投标交易平台U-KEY办理方法相关信息见中国石油招标投标网-通知通告-操作指南。</p>\n<p>4.4、购买招标文件采用网上支付（电子招标投标交易平台内）的模式，目前系统只支持个人网银支付。</p>\n<p><strong>（提醒：支付前请先安装昆仑银行支付控件，进入电子招标投标交易平台右上角工具中心中下载。）</strong></p>\n<p>4.5 若通过个人账户购买，将被认为购买人已经获得公司授权，等同于公司购买，不接受个人名义购买。购买前请核实个人银行卡的网上支付单笔限额不少于招标文件售价，以免影响招标文件的购买。</p>\n<p>4.6 潜在投标人在购买招标文件时，应确认投标人名称、通信地址、联系人、联系方式及增值税发票等基本信息准确无误，招投标全流程信息发布和联络以此为准。招标过程中因联络方式有误导致的一切后果由投标人自行承担。</p>\n<p>4.7 支付成功后，购买状态变为已付款，潜在投标人可在电子交易平台上下载招标文件电子版，招标机构不再提供任何纸质招标文件。支付成功，即视为招标文件已经售出，文件一经售出概不退款。</p>\n<p>4.8 招标文件购买操作失败或其他系统问题，请致电平台服务热线，见第十条。</p>\n<p><strong>五、投标文件的递交</strong></p>\n<p>5.1 投标文件递交截止时间<strong><u>2022年01月28日09:00:00时</u></strong>（北京时间，24小时制），电子版投标文件上传至中国石油电子招标投标交易平台。</p>\n<p>5.2 投标人需在截止时间前完成投标文件的编制、签名、加密、上传及验签操作，并保证投标文件的完整性。如在递交截止时间前未能成功上传投标文件，投标将被拒绝。</p>\n<p><strong>（考虑投标人众多，为避免受网络等因素影响，以及平台技术支持时间需要，请尽量于投标截止时间前24小时完成电子版投标文件的上传。）</strong></p>\n<p>5.3 投标人应在开标前，<strong>支付投标保证金伍万元/标段（以投标文件递交截止时间前到账为准）</strong>。</p>\n<p>投标保证金应从投标人基本账户通过企业网银支付或电汇形式向昆仑银行电子招投标保证金专户汇出，昆仑银行将依此向抚顺石化公司招标中心提供投标保证金担保明细，<strong>汇款信息见第九条</strong>。</p>\n<p>投标保证金汇入昆仑银行保证金专户后，还须登录中国石油电子招标投标交易平台，进入本项目主控台，递交投标保证金，支付完成后，购买状态变为已付款，方为递交成功。</p>\n<p><strong>（提醒：如投标人是首次向昆仑银行递交投标保证金，请至少提前5日向昆仑银行保证金专户汇款并成功递交保证金，以免因信息不同步等原因导致无法汇款和递交，如出现以上问题，请致电平台服务热线，见第十条。）</strong></p>\n<p><strong>六、发布公告的媒体</strong></p>\n<p>本次招标公告在中国石油招标投标网（http://www.cnpcbidding.com）上发布。</p>\n<p><strong>（从其他渠道获取招标信息造成投标人损失的，由投标人自行承担，招标人、招标组织单位概不负责。）</strong></p>\n<p><strong>七、开标</strong></p>\n<p>开标时间：<strong><u>2022年01月28日9:00:00时</u></strong>（北京时间，24小时制）</p>\n<p>开标地点：中国石油电子招标投标交易平台线上开标</p>\n<p>投标人可按时进入中国石油电子招标投标交易平台开标大厅参加开标仪式，查看开标结果。</p>\n<p><strong>八、招标人及招标机构信息</strong></p>\n<p>招 标 人：中国石油天然气股份有限公司抚顺石化分公司</p>\n<p>地 址：抚顺市新抚区凤翔路45号</p>\n<p>邮政编码：113008</p>\n<p>招标项目组织单位：抚顺石化公司招标中心</p>\n<p>地 址：抚顺市顺城区颐城街43号（天湖桥北金水岸小区南门东200米金水岸售楼处）</p>\n<p>联 系 人：<strong>韩文锋</strong></p>\n<p>邮政编码：113006</p>\n<p>电 话：<strong>024-52990850</strong>&nbsp;&nbsp;传真：024-52795588 电子邮件：<strong>hanwenfeng<a href=\"mailto:fsshzbzx@petrochina.com.cn\">@petrochina.com.cn</a></strong></p>\n<p><strong>九、投标保证金汇款信息：</strong></p>\n<p>账户名：昆仑银行电子招投标保证金</p>\n<p>银行账号：<strong>26902100171850000010</strong></p>\n<p>开户行：昆仑银行股份有限公司大庆分行</p>\n<p>开户行行号：<strong>313265010019</strong></p>\n<p>昆仑银行客服电话：<strong>0459-6069508</strong></p>\n<p><strong>十、系统运维信息：</strong></p>\n<p>中国石油电子招标投标交易平台运营单位：中油物采信息技术有限公司</p>\n<p>中国石油电子招标投标交易平台服务热线：<strong>4008800114</strong>，根据语音提示说出&ldquo;电子招标&rdquo;，系统将自动接入人工座席。</p>\n<p>本平台操作方法详见《投标人用户手册》，潜在投标人登录平台后右上角工具中心中下载。</p>\n<p>中国石油招标投标网网址：<strong><a href=\"http://www.cnpcbidding.com/\">http://www.cnpcbidding.com</a></strong>。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h1>&nbsp;</h1>'),('1478670078838902785','2022-2023年微地震工程技术服务项目','1','/static/preview.jpg','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/599b5e4b7b994568b84f446e248740afservice_oss.zip','Finally','2022-01-05 18:09:54','2022-01-07 15:34:48','<p><strong>一、招标条件</strong></p>\n<p>本项目已按要求履行了相关报批及备案等手续，具备招标条件，现进行公开招标，本项目的资格审查方式为<u>资格后审</u>。</p>\n<p><strong>二、项目概况与招标范围</strong></p>\n<p>2.1项目名称：2022-2023年微地震工程技术服务项目；</p>\n<p>2.2招标编号：2022FG94001；</p>\n<p>2.3项目概况：提供井下微地震监测配套设备及现场技术服务；</p>\n<p>2.4计划投资：6000万元(不含税)；</p>\n<p>2.5服务期限：自合同签订之日起至2023年12月31日止；</p>\n<p>2.6项目实施地点：甲方指定施工现场；</p>\n<p>2.7招标范围：采用井下微地震监测技术监测2022-2023年井压裂施工过程，记录压裂过程中的微地震活动,对监测结果进行现场实时解释，指导压裂施工；对监测数据进行精细的处理及解释,描述裂缝方位、长、宽、高等裂缝参数，明确储层改造体积，评估压裂效果；利用计算机成像技术绘制压裂位置周围地层微地震活动的三维图。本项目预计采用井下微地震监测技术监测井压裂施工过程，以甲方实际需求为准。本项目主要工作量在2022-2023年执行，具体施工井的数量尚不明确，以2022-2023年甲方实际需求为准。本项目为框架招标，确定中标人数量为2人，中标人根据2022-2023年微地震工程技术服务项目的实际井数量，按照排名进行分配，第一名分配60%工作量，第二名分配40%工作量。关于招标范围的详细说明见招标编号为2022FG94001的招标文件中第四章&ldquo;技术标准和要求&rdquo;。</p>\n<p><strong>三、投标人资格要求</strong></p>\n<p>3.1本项目不接受联合体投标；</p>\n<p>3.2投标人须为合格法人或其他组织，具备有效的营业执照或事业单位法人证书；</p>\n<p>3.3投标人须具有GB/T19001-2016或ISO9001:2015质量管理体系认证证书；</p>\n<p>3.4本项目投标人累计失信分值达到下述①～④项标准之一的，将被否决投标。</p>\n<p>① 投标人失信分累计达到8分，且最后一次失信开始时间距开标当日不足半年；</p>\n<p>② 投标人失信分累计达到9分，且最后一次失信开始时间距开标当日不足一年；</p>\n<p>③ 投标人失信分累计达到10分，且最后一次失信开始时间距开标当日不足二年；</p>\n<p>④ 投标人失信分累计达到10.5分及以上，且最后一次失信开始时间距开标当日不足三年。投标人失信分以开标当日中国石油招标投标网发布的失信行为信息为准，由评委在评审时进行网络查询，若有失信行为保留查询截图存档；</p>\n<p>3.5本项目要求投标人承诺按照投标文件投入设备及人员组织施工，确保微地震监测技术服务满足生产需要、在提供微地震监测技术服务的过程中，采用的设备、设施或方法无侵犯他人或企业权利的情形；</p>\n<p>=<strong>四、招标文件的获取</strong></p>\n<p>4.1 凡有意参加投标者，请于&nbsp;2022-01-07&nbsp;09:00:00至 2022-01-12&nbsp;23:59:59&nbsp;（北京时间，下同），投标人登录&ldquo;中国石油电子招标投标交易平台http://ebidmanage.cnpcbidding.com&rdquo;注册账户，并在线报名投标。<br /><strong>详见 附件1</strong><strong>、</strong><strong>2</strong><strong>：</strong><strong>购买招标文件温馨提示</strong></p>\n<p>凡招标公告要求在&ldquo;中国石油电子招标投标交易平台&rdquo;上报名或递交投标文件的，投标人注册后，还须到昆仑银行股份有限公司办理电子招标平台U-Key。已有U-key的，无需重复办理。<br /><strong>详见 附件</strong><strong>3</strong><strong>：关于申领中国石油招投标优蓝U-Key的公告</strong></p>\n<p>4.2招标文件售价1000元。购买招标文件凡支付成功的，即视为招标文件已经售出，文件一经售出概不退款。招标代理机构现已上线电子发票，电子发票开票信息默认为投标人通过中国石油电子招标投标交易平台初始录入信息，系统推送电子发票默认平台预留手机号及邮箱，若以上信息有误请在开标前修改为正确信息，招标代理机构将于开标后七个工作日内发送电子发票至投标人平台预留手机号及邮箱。领取发票咨询电话：0459-5183118。潜在投标人在购买招标文件时，应确认投标人名称、通信地址、联系人、联系方式及发票信息等基本信息准确无误，招投标信息发布和联络以此为准。招标过程中因联络方式有误导致的一切后果由投标人自行承担。</p>\n<p><strong>详见 附件</strong><strong>4</strong><strong>：购买和下载招标文件操作步骤。</strong><br />4.3招标文件购买操作失败或其他系统问题，请与平台运营单位联系。</p>\n<p>咨询电话:4008800114。</p>\n<p><strong>五、投标文件的递交</strong></p>\n<p>5.1投标文件递交的截止时间（投标截止时间，下同）为<u>2022-01-17 &nbsp;09:00:00</u>，递交方式为在&ldquo;中国石油电子招标投标交易平台&rdquo;加密上传。投标人通过&ldquo;中国石油电子招标投标交易平台&rdquo;提报电子版投标文件，纸质版投标文件不予接受。<br />5.2投标人需在投标文件递交截止时间之前完成投标文件的编制、签名、加密、上传及验签操作，并保证文件的完整性。(考虑投标人众多，避免受网速影响，以及网站技术支持的时间，建议投标截至时间前24小时完成网上电子版的提交。）电子投标文件的提交须使用已灌章的U-key。未办理U-key的投标人，需到昆仑银行办理U-key。</p>\n<p><strong>详见 附件2：U-KEY办理流程</strong></p>\n<p>5.3投标截止时间前未被系统成功传送的电子版投标文件将不被系统接受，视为主动撤回投标文件。</p>\n<p>5.4投标人应从其基本帐户通过企业网银或电汇形式向昆仑银行支付投标保证金人民币小写<u>20000</u>元（大写<u>贰万</u><u>元</u>），并在开标时间前将相应额度的资金提交（分配）至对应标段（包），支付成功后该标段的保证金购买状态将由未付款变为已付款，昆仑银行向&ldquo;中国石油电子招标投标交易平台&rdquo;发送电子担保通知。</p>\n<p><strong>详见 附件4：投标保证金递交流程</strong></p>\n<p>投标保证金账户信息如下：<br />昆仑银行账户名：昆仑银行电子招投标保证金<br />&nbsp;账号：26902100171850000010<br />开户行：昆仑银行股份有限公司大庆分行<br />开户行行号：313265010019（以昆仑银行最新开户行行号为准）</p>\n<p>昆仑银行U-Key办理、投标保证金业务咨询电话：4006696569、0459-6069508、0459-6069503</p>\n<p>5.5 针对目前部分投标人U-key到期的问题普遍存在，以至于开标解密无法正常进行提示：<br />投标人若涉及U-key到期的问题，请及时补办，务必确保在投标文件加密、上传及开标解密时U-key仍然处于有效状态。否则按照招标文件中约定：因投标人原因造成投标文件未解密成功的，视为撤销其投标文件；因投标人之外的原因造成投标文件未解密成功的，视为撤回其投标文件。部分投标文件未解密成功的，其他投标文件的开标可以继续进行。</p>\n<p><strong>六、发布公告的媒介</strong></p>\n<p>本次招标公告同时在&ldquo;中国招标投标公共服务平台（http://www.cebpubservice.com）&rdquo;，&ldquo;中国石油招标投标网（<a href=\"http://www.cnpcbidding.xn--com%29%2C-oq1hx8bv2cs0fksi80ppvpbjn4ho9sdkyzt37aed4gfprb47i/\">www.cnpcbidding.com）</a>&rdquo;发布。</p>\n<p><strong>七、开标</strong></p>\n<p>7.1 开标时间：&nbsp;<u>2022-01-17 &nbsp;09:00:00</u>。</p>\n<p>7.2 网上开标大厅：中国石油电子招标投标交易平台http://ebidmanage.cnpcbidding.com</p>\n<p><strong>八、联系方式</strong></p>\n<p>招标代理机构：大庆油田招标中心有限责任公司</p>\n<p>单位地址：黑龙江省大庆市让胡路区西宾路552号</p>\n<p>联 系 人：李英凯</p>\n<p>联系电话：0459-5394080&nbsp;</p>\n<p>邮箱：js_lyk2018@cnpc.com.cn&nbsp;</p>\n<p>&nbsp;</p>\n<p>招标人：中国石油集团测井有限公司大庆分公司&nbsp;&nbsp;</p>\n<p>联系人：周山&nbsp;</p>\n<p>联系电话：13946942580&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p>电子招标运营单位：中油物采信息技术有限公司<br />咨询电话:4008800114如有疑问请在工作时间咨询<br />招标公告中未尽事宜或与招标文件不符之处，以招标文件为准。</p>'),('1478670259948949505','板式办公家具','2','/static/preview.jpg','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/60143e1d693144d19b95caa6a1407d7fservice_oss.zip','Finally','2022-01-05 18:10:37','2022-03-02 20:48:09','<p><strong>一、招标条件</strong></p>\n<p>本招标项目已按要求履行了相关报批及备案等手续，资金（资金来源）已落实，具备招标条件。</p>\n<p><strong>二、项目概况与招标范围</strong></p>\n<p>2.1 本项目概况：大庆油田招标中心有限责任公司受<a name=\"projectTenderName_0077196\"></a>大庆油田物资公司劳保用品分公司（简称招标人）委托，就<a name=\"projectScopeContent_0091075\"></a>大庆油田所需板式办公家具家具（见货物需求明细表）&nbsp;进行<a name=\"projectTender_0046986\"></a>公开招标，本次招标为:<a name=\"bidformname_0003679\"></a>本次招标为定商定价招标。只确定中标人和中标价格，不确定供货数量。招标人将选取实质上响应招标文件的要求并有履行合同能力的综合