总长175m；（4）新建砼道路8条，总长3.963km；（5）主要配套建筑物2274座；（6）布设片区简介管护牌、标示牌每个片区各一座。。招标控制价19,826,355.76元。</div>\n<div>2.3计划 工期（服务期）：120日历天。</div>\n<div>2.4标段划分：</div>\n<div><u>标段1: 标段名称: 乐东县2022年大安镇高标准农田建设项目（一标段）;标段编号: hizw20220302001001;标段类型: 施工;控制价：7065645.8100</u></div>\n<div><u>标段2: 标段名称: 乐东县2022年大安镇高标准农田建设项目（二标段）;标段编号: hizw20220302001002;标段类型: 施工;控制价：5980059.6000</u></div>\n<div><u>标段3: 标段名称: 乐东县2022年大安镇高标准农田建设项目（三标段）;标段编号: hizw20220302001003;标段类型: 施工;控制价：6780650.3500</u></div>\n<div>2.5招标范围：</div>\n<div><u>标段1:施工总承包（具体以工程量清单及施工图为准）</u></div>\n<div><u>标段2:施工总承包（具体以工程量清单及施工图为准）</u></div>\n<div><u>标段3:施工总承包（具体以工程量清单及施工图为准）</u></div>\n<div>2.6质量要求：</div>\n<div><u>标段1:合格</u></div>\n<div><u>标段2:合格</u></div>\n<div><u>标段3:合格</u></div>\n<div>&nbsp;</div>\n<div>3.投标人资格要求</div>\n<div>3.1 标段1：本次招标要求投标人须具备&nbsp;<span id=\"enterpriseQuaSelect_bb54a2887f30e1ff017f3f2ae6a43b3d\"><u>独立法人资格和有效的安全生产许可证，同时具有行政主管部门颁发的水利水电工程施工总承包叁级或以上资质或根据《住房和城乡建设部关于印发建设工程企业资质管理制度改革方案的通知》(建市〔2020〕94 号)换发新证的水利水电工程施工总承包乙级或以上资质。 财务要求：不要求 业绩要求：不要求 信誉要求：①投标人的投标资格没有被取消、限制、暂停； ②投标人没有被处于被责令停业、财产被接管、冻结、破产状态；③在投标截止时间之日止近 3 年内没有骗取中标行为或严重违约事件，所参与的工程建设项目没有发生重大质量安全责任事故。【证明材料：提供加盖公章的信誉承诺函，格式自拟】 项目经理(建造师，下同)资格：投标人拟派项目负责人（项目经理）须具备在本单位注册的水利水电工程专业二级或以上注册建造师执业资格，且不得担任其他在施建设工程项目的项目经理。拟派本项目负责人的注册证书原件或临时执业证书原件应与报名时填写的负责人一致。技术负责人资格：投标人拟派项目技术负责人须具备水利工程类专业中级或以上技术职称。【证明材料：投标人须在投标文件中附有项目技术负责人职称证及在本单位缴纳的2021 年 1 月至今任意 1 个月社保证明材料复印件并加盖公章】 其它要求：①投标人被人民法院列为失信被执行人的，投标活动依法予以限制。【证明材料：投标人提供在&ldquo;信用中国 （或链接至中国执行信息公开网）&rdquo;网站（www.creditchina.gov.cn）查询截图并加盖公章。】 ②本项目共3个标段，各投标人均可就本招标项目上述标段中的1个标段投标，但最多允许中标1个标段。</u></span></div>\n<div>标段2：本次招标要求投标人须具备&nbsp;<span id=\"enterpriseQuaSelect_bb54a2887f30e1ff017f3f38143e3d46\"><u>独立法人资格和有效的安全生产许可证，同时具有行政主管部门颁发的水利水电工程施工总承包叁级或以上资质或根据《住房和城乡建设部关于印发建设工程企业资质管理制度改革方案的通知》(建市〔2020〕94 号)换发新证的水利水电工程施工总承包乙级或以上资质。 财务要求：不要求 业绩要求：不要求 信誉要求：①投标人的投标资格没有被取消、限制、暂停； ②投标人没有被处于被责令停业、财产被接管、冻结、破产状态；③在投标截止时间之日止近 3 年内没有骗取中标行为或严重违约事件，所参与的工程建设项目没有发生重大质量安全责任事故。【证明材料：提供加盖公章的信誉承诺函，格式自拟】 项目经理(建造师，下同)资格：投标人拟派项目负责人（项目经理）须具备在本单位注册的水利水电工程专业二级或以上