u>1</u>（标段名称：<u>乐东县2022年大安镇高标准农田建设项目（一标段）</u>）： 招标文件每套售价；&nbsp;<span id=\"filePrise_bb54a2887f30e1ff017f3f2ae6a43b3d\"><u>500</u></span>&nbsp;元，（提供选择&nbsp;<u>含</u>&nbsp;图纸），售后不退；投标保证金的金额为：<u>50,000</u>元。</div>\n<div>标段<u>2</u>（标段名称：<u>乐东县2022年大安镇高标准农田建设项目（二标段）</u>）： 招标文件每套售价；&nbsp;<span id=\"filePrise_bb54a2887f30e1ff017f3f38143e3d46\"><u>500</u></span>&nbsp;元，（提供选择&nbsp;<u>含</u>&nbsp;图纸），售后不退；投标保证金的金额为：<u>50,000</u>元。</div>\n<div>标段<u>3</u>（标段名称：<u>乐东县2022年大安镇高标准农田建设项目（三标段）</u>）： 招标文件每套售价；&nbsp;<span id=\"filePrise_bb54a2887f30e1ff017f3f3a963f3d91\"><u>500</u></span>&nbsp;元，（提供选择&nbsp;<u>含</u>&nbsp;图纸），售后不退；投标保证金的金额为：<u>50,000</u>元。</div>\n<div>5.投标文件和保证金的递交</div>\n<div>5.1投标文件递交的截止时间（投标截止时间，下同）为&nbsp;<span id=\"submitTimeEndId\"><u>2022-3-23 8:30:00</u></span>&nbsp;，地点为：<span id=\"fileSubmitPlace\"><u>海南省公共资源交易服务中心（海口市国兴大道9号）202开标室</u></span>。（适用于现场递交）</div>\n<div>5.2投标文件递交的截止时间（投标截止时间，下同）为&nbsp;<span id=\"submitTimeEndId\"><u>2022-3-23 8:30:00</u></span>&nbsp;。投标人应当通过数字身份认证锁登录<span id=\"fileSubmitUrl\"><u>全国公共资源交易平台（海南省）（http://zw.hainan.gov.cn/ggzy/）</u></span>上传。（适用于网络递交）</div>\n<div>5.3投标保证金到账截止日期：&nbsp;<span id=\"submitTimeEndId\"><u>2022-3-23 8:30:00</u></span>&nbsp;，投标保证金的形式：网上支付或线下银行转账支付<span id=\"depositSubmitMethod\"><u>银行转账支付或银行保函或建设工程投标保证保险</u></span>，支付地址：http://zw.hainan.gov.cn/ggzy/。</div>\n<div>5.4逾期送达的或者未送达指定地点的投标文件，招标人不予受理。</div>\n<div>6.发布公告的媒介</div>\n<div>本次招标公告在&nbsp;<span id=\"publicAddress\"><u>《全国公共资源交易平台（海南省）》《中国招标投标公共服务平台》《乐东黎族自治县人民政府网》</u></span>等媒介上发布。</div>\n<div>7.其他</div>\n<div>7.1投标人须在全国公共资源交易平台（海南省）企业信息管理系(http://zw.hainan.gov.cn /ggzy/)中登记企业信息 , 然后登陆招标投标交易平台(http://zw.hainan.gov.cn/ggzy/)下载，查看电子版的招标文件及 其他文件；</div>\n<div>7.2电子标（招标文件后缀名.GZBS）：必须使用最新版本的电子投标工具（在http://zw.hainan.gov.cn/ggzy/ggzy/xgrjxz/index.jhtml下载投标工具）制作电子版的投标文件；</div>\n<div>非电子标（招标文件后缀名不是.GZBS）：必须使用电子签章工具（在http://zw.hainan.gov.cn/ggzy/ggzy/xgrjxz/index.jhtml下载签章工具）对PDF格式的电子投标文件进行盖章(使用WinRAR对PDF格式的标书加密压缩)；</div>\n<div>7.3投标截止时间前，必须在网上上传电子投标书&mdash;&mdash;（电子标：投标书为GTBS格式；非电子标：投标书需上传PDF加密压缩的rar格式）；</div>\n<div>7.4开标的时候必须携带加密锁(CA数字认证锁)和光盘、U盘拷贝的电子版投标书。</div>');

