DROP TABLE IF EXISTS `manage_employees`;

CREATE TABLE `manage_employees` (
  `id` char(19) NOT NULL COMMENT 'ID',
  `name` varchar(20) NOT NULL COMMENT '姓名',
  `intro` varchar(500) NOT NULL DEFAULT '' COMMENT '简介',
  `career` varchar(500) DEFAULT NULL COMMENT '资历,一句话说明',
  `level` int(10) unsigned NOT NULL COMMENT '头衔 1员工 2管理',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `is_deleted` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '逻辑删除 1（true）已删除， 0（false）未删除',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='员工';

