insert  into `manage_item`(`id`,`name`,`img`,`is_deleted`,`gmt_create`,`gmt_modified`,`status`,`department`,`description`) values ('1478671004660207617','济青高速公路改扩建工程','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/ee65c675f06e42df98acf9a96845381f20211108091046.jpg',0,'2022-01-05 18:13:35','2022-01-05 19:02:01','Normal','2','<p><span lang=\"EN-US\">&nbsp;</span>（王富强 讯）<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">4</span>日，中国公路建设行业协会传来喜讯，公司济青高速公路改扩建工程荣获<span lang=\"EN-US\">2020-2021</span>年度（第二批）<span lang=\"EN-US\">&ldquo;</span>公路交通优质工程奖<span lang=\"EN-US\">&rdquo;</span>，王晓雷、张建立、卢岩三位同志被授予<span lang=\"EN-US\">&ldquo;</span>优秀项目建设者<span lang=\"EN-US\">&rdquo;</span>荣誉称号。</p>\n<p>公路交通优质工程奖即李春奖，系全国公路建设最高质量奖。济青高速公路改扩建工程作为八局第一条公路改扩建项目，是交通运输部高速公路改扩建绿色科技示范标杆，是山东省新旧动能转换重点项目。在公司领导的大力支持下，济青改扩建项目全体参建人员克服环保压力、材料价格上涨等诸多困难，项目部倒排工期、统筹谋划，加班加点，最终提前<span lang=\"EN-US\">5</span>个月建成通车，实现完美履约。</p>\n<p>山东公司将继续坚持高标准严要求，过硬品质打造匠心工程，为公司高质量发展助力。</p>'),('1478681284605710337','公司雄安枢纽项目一期工程一标段地面道路','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/623b257facd5497d8a39702d4c41ea33QQ图片20220105185435.jpg',0,'2022-01-05 18:54:25','2022-01-05 18:54:47','Normal','2','<p style=\"font-weight: 400;\">11月2日，雄安佐良街完成左幅最后一层沥青铺设，标志着公司雄安枢纽项目地面道路全面竣工，全力打赢秋季&ldquo;收官战&rdquo;，为雄安枢纽地面道路网络建设画上点睛一笔。雄安枢纽项目为公司智能装备公司首个独立专业承包路面施工项目，是雄安站东广场配套主干道，设计时速50km/h双向6车道。</p>\n<p style=\"font-weight: 400;\">本次摊铺作业历时33天，完成全线4.7公里市政道路摊铺作业。施工过程采取半幅摊铺半幅通车作业方式，既保障保通段车辆正常通行，也保证非保通段兄弟单位正常施工。雄安枢纽地面道路完工，将有效缓解本片区交通压力，完善片区交通网络，将雄安高铁站与周围居民聚集区有效连接在一起为雄安未来之城注入活力。</p>'),('1478681714077274114','公司中标连云港西连岛综合开发工程等新兴业务','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/036e9688899a4a28a684c9cad52e309eQQ图片20220105185621.jpg',0,'2022-01-05 18:56:08','2022-01-05 18:56:36','Normal','3','<p class=\"p\" align=\"justify\">金秋十月，捷报频传。公司中标连云港西连岛综合开发工程、茂名第一污水处理厂、凤江污水处理厂、揭西广德生态园，丰富公司&ldquo;1237&rdquo;产品定位新兴业务内涵。积极践行绿色发展理念，打造新兴业务土木品牌。</p>\n<p class=\"p\" align=\"justify\">连云港西连岛综合开发工程位于连云港市连云区连岛及周边，包含渔村客厅、精品酒店街区、灯塔验潮站迁建、小龟山沿海段落整治、西环岛路改扩建、中心渔港工程、山地聚落民宿提升改造工程等，兼顾旅游、娱乐、休闲、餐饮、水运等多种配套服务设施建设。</p>\n<p class=\"p\" align=\"justify\">依据《云台山风景名胜区总体规划（2011-2030）》部署，连岛游览区被纳入云台山风景名胜区核心景区，结合连岛环境承载力，将在此建设具有苏北海滨独特魅力的旅游度假设施，开展海上观光、海上竞技、海滨养生、海岛会议等多种活动，使海滨资源得到充分利用。</p>\n<p class=\"p\" align=\"justify\"><img src=\"http://cccec.com.cn/Uploads/keditor/image/20211028/20211028092657_70925.jpeg\" alt=\"\" /></p>\n<p class=\"p\" align=\"justify\">茂名市第一污水处理厂提标扩容改造及河东片区污水总管项目（第二分部二期扩建工程），项目建设包含生活污水总进厂管道接驳、预处理区域、生物池等工程。项目建成后，将进一步改善茂名市水域功能，减少环境污染给居民生活带来的负面影响，改善生态环境，实现城市经济与环境的协调可持续发展。</p>\n<p class=\"p\" align=\"justify\"><img src=\"http://cccec.com.cn/Uploads/keditor/image/20211028/20211028092639_80359.jpeg\" alt=\"\" /></p>\n<p class=\"p\" align=\"justify\">凤江镇青头庵污水处理厂新建工程及阳下污水处理厂提标改造项目位于广东省揭阳市揭西县凤江镇阳夏片区，包括青头庵污水处理厂新建工程和阳夏污水处理厂提标改造工程。项目实施将改善区域内生态环境，恢复青头庵、丰吉涵支流入河口正常生态流水功能，进一步改善城市生态环境，提高居民生活质量。</p>\n<p class=\"p\" align=\"justify\">&nbsp;<img src=\"http://cccec.com.cn/Uploads/keditor/image/20211028/20211028092624_25551.jpeg\" alt=\"\" /></p>\n<p class=\"p\" align=\"justify\">揭西县城广德生态区建设项目主要建设内容为公园、建筑、交通、生态、设施五大方面。项目建造的绿道网络体系集生态保育、休闲游憩、科普教育为一体，具有旅游观光、运动康体、休闲度假、徒步远足、登山眺远等功能，着力将其打造成为揭阳市绿道网建设示范性工程。</p>'),('1478682303146299394','公司沈白高铁项目首根桩基顺利开钻','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/6802f578de404a7fab18441dfb4c0930QQ图片20220105185922.jpg',0,'2022-01-05 18:58:28','2022-01-06 13:48:43','Normal','1','<p style=\"font-weight: 400;\">（冉令皓&nbsp;&nbsp;讯）9月4日上午，华北公司沈白高铁项目跨S304省道特大桥首根桩基顺利开钻。</p>\n<p style=\"font-weight: 400;\">沈白高铁项目全长44.44公里，整个标段共有桥桩基2869根，其中跨S304省道特大桥全长1023.11米，总计桥桩基192根，计划工期51天。</p>\n<p style=\"font-weight: 400;\">项目部自进场以来，广大员工以昂扬的斗志迅速展开现场勘察、测量放线、安摊建点等工作。为确保首桩施工顺利开展，项目部员工群策群力，深入细化施工调查，反复优化施组编制，克服了前期人员不足、征拆协调困难等一系列难题，如期实现了首桩顺利开钻。</p>\n<p style=\"font-weight: 400;\">首桩的顺利开钻，极大地鼓舞了员工士气，沈白高铁项目将会以此为契机再接再厉，力争多开工作面，大干快上，高质量完成公司下达的各项任务。</p>'),('1494515739014557697','test','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2021/12/24/87167857c4124213af510cd2d95633betest.jpg',0,'2022-02-18 11:34:54','2022-02-18 11:36:30','Normal','1','<p>aaa</p>');

