/*Data for the table `news` */

insert  into `news`(`id`,`category`,`title`,`introduction`,`image`,`gmt_create`,`content`,`gmt_modified`,`status`) values ('1478666005284720642',1,'2021年全国装配式桥梁智能建造技术暨智慧梁场现场观摩会在公司郑济高铁项目成功举行','10月31日，以“智汇桥梁装配化，共创绿色新基建”为主题，2021年全国装配式桥梁智能建造技术暨智慧梁场现场观摩会在公司郑济高铁项目成功举行。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/8649a5f188404050bd4761ecc60beb41QQ图片20220105182321.jpg','2022-01-05 17:53:43','<p><img src=\"http://www.cccec.com.cn/Uploads/keditor/image/20211108/20211108085509_37199.png\" alt=\"\" /></p>\n<p>&nbsp;</p>\n<p><span lang=\"EN-US\">10</span>月<span lang=\"EN-US\">31</span>日，以<span lang=\"EN-US\">&ldquo;</span>智汇桥梁装配化，共创绿色新基建<span lang=\"EN-US\">&rdquo;</span>为主题，<span lang=\"EN-US\">2021</span>年全国装配式桥梁智能建造技术暨智慧梁场现场观摩会在公司郑济高铁项目成功举行。</p>\n<p>中国工程院院士周丰峻，中国交通运输协会新技术促进分会副会长兼秘书长于丁，聊城市交通运输局党组书记、局长张俊之，济郑高速铁路有限公司总经理刘杰民，郑济高铁建设指挥部指挥长王强、总工程师赵西法，中建八局副总工程师马俊，中建八局基础设施事业部副总经理梁田录、总工程师陈锦明，中建八局郑济高铁指挥长刘继锋，公司党委副书记、副总经理韩冰，山东公司党总支书记、总经理刘嘉东，安徽省交通规划设计研究总院工程技术研究院、中铁、中交各及全国各产、学、研单位与会嘉宾代表<span lang=\"EN-US\">90</span>余人参会。<span lang=\"EN-US\">&nbsp;</span></p>\n<section>\n<p>开幕式上，韩冰、马俊、王强、张俊之、于丁先后致辞，充分肯定公司郑济高铁项目在高速铁路施工中率先采用的高端云平台管理系统与新技术、新工艺、新设备，希望项目智慧化专业梁场能发挥科技创新引领示范作用。</p>\n<p>交流环节，近百名专家齐聚一堂，就推广和应用桥梁预制装配式、落实绿色发展理念进行交流学习。与会专家观点新颖、精彩纷呈，分别就《桥梁交通工程发展战略与公共安全问题》《高烈度区装配式墩桩壳式连接创新与实践》《高速铁路梁场<span lang=\"EN-US\">OSS</span>智慧云平台》《世界最大跨度三主桁钢桁拱桥&mdash;明珠湾大桥设计与施工控制关键技术》《现代桥梁施工用智能模板全方位设备&mdash;智慧梁场必备》课题作学术专题报告，共同交流装配式桥梁智能建造技术。</p>\n<p>交流会结束后，与会专家、学者们到项目智慧化专业梁场进行考察观摩，重点参观智慧展厅及梁场智控中心。</p>\n</section>','2022-01-05 20:39:19','Normal'),('1478679867878871042',2,'公司与中国环境科学研究院环境技术工程有限公司签署战略合作框架协议','（刘一麟 讯）11月24日，公司与中国环境科学研究院环境技术工程有限公司签署战略合作协议。公司党委书记、董事长哈小平，党委副书记、工会主席李伟、检测科技公司总经理刘广华、市场部副总经理韩超、工程研究院副院长刘斌，中国环境科学研究院环境技术工程有限公司总经理田智勇、总工程师张磊、副总经理杨海超等出席签约仪式。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/f665c717bfcf434f8202f607ccc15915QQ图片20220105184825.jpg','2022-01-05 18:48:48','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>（刘一麟 讯）<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">24</span>日，公司与中国环境科学研究院环境技术工程有限公司签署战略合作协议。公司党委书记、董事长哈小平，党委副书记、工会主席李伟、检测科技公司总经理刘广华、市场部副总经理韩超、工程研究院副院长刘斌，中国环境科学研究院环境技术工程有限公司总经理田智勇、总工程师张磊、副总经理杨海超等出席签约仪式。</p>\n<p>中国环境科学研究院环境技术工程有限公司成立于<span lang=\"EN-US\">1992</span>年，是中国环境科学研究院控股的国有综合性企业，是生态环境部系统唯一的专业性工程公司和综合性平台公司。其依托中国环境科学研究院<span lang=\"EN-US\">2</span>个国家级重点实验室、<span lang=\"EN-US\">9</span>个部级重点实验室、生态环境领域全要素科研体系以及高层次专家和人才优势，在高端咨询、技术创新和项目实施等方面代表着国家队的实力水平，多年来致力于环境污染治理与生态环境修复，尤其在新技术、新工艺的推广应用方面取得了卓越成效。</p>\n<p>中国环境科学研究院环境技术工程有限公司的技术、资源优势与公司主营业务有着天然的优势互补性。此次战略合作协议的签订，为公司在环境污染治理与生态环境修复等新兴业务领域积累了专业合作资源，为公司<span lang=\"EN-US\">&ldquo;1237&rdquo;</span>产品结构战略的全面落地提供了有效支撑。</p>','2022-01-05 20:39:01','Normal'),('1478680770283376642',1,'公司三季度经济运营分析会暨深化低成本战略、强化价值创造启动会在京召开','为提高经济运营质量，深入贯彻落实局三季度运营分析会会议精神，总结检视公司前三季度工作完成情况，研判内外部形势，剖析存在的问题与不足，部署推进四季度重点工作，为确保完成全年目标任务打下坚实基础。10月26日，公司三季度经济运营分析会暨深化低成本战略、强化价值创造启动会在京召开。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/ac5e882c418b450ba750c5244f7108f4QQ图片20220105185205.jpg','2022-01-05 18:52:23','<p style=\"font-weight: 400;\">为提高经济运营质量，深入贯彻落实局三季度运营分析会会议精神，总结检视公司前三季度工作完成情况，研判内外部形势，剖析存在的问题与不足，部署推进四季度重点工作，为确保完成全年目标任务打下坚实基础。10月26日，公司三季度经济运营分析会暨深化低成本战略、强化价值创造启动会在京召开。</p>\n<p style=\"font-weight: 400;\">会议采取现场+视频形式，共设1个主会场、8个分会场。公司党委书记、董事长哈小平，纪委书记李延平，总会计师熊瑶，总工程师刘永福，总经济师曹玉章，副总经理毕延宝，党委副书记、工会主席李伟，总法律顾问李秋贵，总部相关部门负责人，二级单位主要领导及相关部门负责人参会。会议由熊瑶主持。</p>\n<p style=\"font-weight: 400;\"><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">哈小平结合前三季度经济运行情况，分析企业当前发展现状。他指出，要进一步强化价值创造能力，以营造降本增效氛围、提升总包合同质量、强化履约过程管控、践行商务创效理念、推进物资精细管理、抓好资金动态平衡、落实运营风险防控、加强技术创新创效、杜绝过程跑冒滴漏九个方面为抓手，为企业行稳致远保驾护航。</p>\n<p style=\"font-weight: 400;\">哈小平结合公司年初既定目标和局经济运营分析会会议精神，做以下四方面要求：</p>\n<p style=\"font-weight: 400;\">一是奋力冲刺年度营销目标。各单位要坚定信心、保持战略定力，集中发力冲刺年度目标。</p>\n<p style=\"font-weight: 400;\">二是全力抢抓生产履约进度。着力推进重点项目产能提升，协调优势资源推进项目完美履约。</p>\n<p style=\"font-weight: 400;\">三是坚决完成年度结算目标。细化分工、责任到人，加快夯实项目成本管控和创收创效。</p>\n<p style=\"font-weight: 400;\">四是持续有力开展专项治理。持续推进&ldquo;六个专项行动&rdquo;进一步走向深入、取得扎实成效。</p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">熊瑶传达局2021年三季度运营分析会党委副书记、总经理章维成和党委书记、董事长李永明讲话精神，勉励全员从坚决完成营销目标、坚决做强转型业务、坚决提升履约品质、坚决优化运营质量四方面咬定全年目标，攻坚决战决胜。</p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">曹玉章结合商法体系主要工作，总结前三季度各项工作完成情况，对商法体系提出&ldquo;肩负使命，积极作为，奋力实现各项指标新突破&rdquo;的整体要求，并安排部署下一步工作内容：一是满怀激情，推进总包结算；二是履约为先，提升计量确权；三是狠抓执行，确保策划创效；四是盘实物料，做实成本分析；五是强化执行，推动招标合规；六是价值引领，持续开展文化建设；七是身体力行，重视体系建设。</p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">公司财务资金部、商务管理部、合约法务部、采购中心、物资管理部分别汇报前三季度主要工作进展情况，通报工作中存在的问题与不足，安排部署四季度重点工作。各二级单位负责人就本单位前三季度指标完成情况、经济运营情况、降杠杆工作完成情况做详细汇报。与会领导对各单位的汇报内容进行点评，并结合各单位现阶段生产经营情况，提出指导性建议和要求。</p>','2022-01-05 20:36:46','Normal'),('1478682954098085890',2,'西北公司鄂尔多斯项目市政工程顺利完工','（郭兴恒  讯）随着给水管道回填结束，鄂尔多斯市康巴什产业园区市政基础设施项目已顺利完成复工协议中的全部施工任务，提前11天启动交工验收程序。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/280a43bbdc6a44468ab21f1c09adfee6QQ图片20220105190049.jpg','2022-01-05 19:01:04','<p style=\"font-weight: 400;\"><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">&nbsp;</p>\n<p style=\"font-weight: 400;\">（郭兴恒&nbsp;&nbsp;讯）随着给水管道回填结束，鄂尔多斯市康巴什产业园区市政基础设施项目已顺利完成复工协议中的全部施工任务，提前11天启动交工验收程序。</p>\n<p style=\"font-weight: 400;\">项目今年复工以来，在面临工期紧、任务重、时间和节点要求高的情况下，项目部按照工期计划，科学组织、精心安排、周密部署，经过40天的艰苦奋战，项目部全员顶住压力，发挥了铁军精神，最终在保质保量的前提下提前完成了施工任务。</p>\n<p style=\"font-weight: 400;\">项目的提前完工，得到了业主方一致肯定，展现了项目员工顽强的拼搏精神，也极大鼓舞了项目全体员工的工作热情，项目部将以此为契机，积极推动工程验收，全面实现总体工期目标，树立良好品牌形象。</p>','2022-01-05 20:36:24','Normal'),('1478709793449381890',2,'真抓实干 履约为先——公司西淅高速公路项目交出优异答卷','公司西淅高速公路项目以总产值比例全线第一、路床交验全线第一、水稳施工全线第一勇夺全线四个标段10月份月度履约考核第一名，获得业主充分肯定。项目自开工以来控疫情、抓质量、保进度，出色完成建设任务，荣获业主表彰22次，用榜样力量为公司发展积势赋能。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/cb98aba4500a4cb18eb795621b44d3c3QQ图片20220105204727.jpg','2022-01-05 20:47:43','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"font-weight: 400;\">公司西淅高速公路项目以总产值比例全线第一、路床交验全线第一、水稳施工全线第一勇夺全线四个标段10月份月度履约考核第一名，获得业主充分肯定。项目自开工以来控疫情、抓质量、保进度，出色完成建设任务，荣获业主表彰22次，用榜样力量为公司发展积势赋能。</p>\n<p style=\"font-weight: 400;\">项目位于河南省南阳市淅川县，建成后将完善区域高速骨架路网，加强豫西南地区的辐射带动，促进晋豫鄂旅游综合开发。</p>\n<p style=\"font-weight: 400;\">项目党支部充分发挥&ldquo;开路先锋&rdquo;党建品牌作用，坚持以党建引领业务、以业务助推党建，抓好理论武装，为党员干部凝心铸魂；用好身边红色资源，提升党史学习教育实效；搭建融合载体，发挥党员先锋模范作用。通过系列党建活动筑牢思想根基，为项目高质量发展注入红色动力，荣获中建八局&ldquo;红色基石&middot;先进基层党组织&rdquo;荣誉称号。</p>\n<p style=\"font-weight: 400;\">项目目前超额完成计划产值，四个标段位居第一。获评业主&ldquo;大干一百天劳动竞赛&rdquo;第一名，中建八局&ldquo;大干120天&nbsp;&nbsp;喜迎建党100周年&rdquo;劳动竞赛优秀项目。</p>','2022-01-05 20:48:01','Normal'),('1478710060181950466',2,'国庆坚守施工一线 海外献礼祖国生日 ——刚果（布）项目国庆期间掀起施工大干热潮','（李金龙 曹清玉  讯）金秋十月秋高气爽，非洲大地在正处夏日，在新中国成立72周年之际，刚果（布）项目全体员工冒着酷暑坚守施工一线，充分利用当前雨季为数不多的晴好天气，抢生产抓进度，用实际行动确保项目按期履约。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/3eb4ffd8b5d34f0fae5b927f29c90720QQ图片20220105204835.jpg','2022-01-05 20:48:46','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p>&nbsp;</p>\n<p class=\"p\">（李金龙&nbsp;曹清玉 &nbsp;讯）金秋十月秋高气爽，非洲大地在正处夏日，在新中国成立72周年之际，刚果（布）项目全体员工冒着酷暑坚守施工一线，充分利用当前雨季为数不多的晴好天气，抢生产抓进度，用实际行动确保项目按期履约。</p>\n<p class=\"p\">国庆假期间，刚果（布）项目每一处施工段落都是热火朝天的大干场景，所有员工奋战一线抢进度、控质量、保节点。大家严格按照既定施工计划，周密部署，稳步推进，同时加大安全监督力度，强化安全生产意识，确保大干期间安全生产平稳有序。</p>\n<p class=\"p\">中西非经理部经理徐成新在节假日深入施工现场开展安全生产及疫情防控带班检查，主动靠前指挥，积极协调项目解决实际问题。他鼓励全体员工要铆足干劲，克服困难，再接再厉，继续提升公司在中西非市场的品牌与口碑。</p>\n<p class=\"p\">目前，刚果（布）项目施工现场有条不紊，所有员工士气高昂，大家表示将会努力克服雨季不利因素，合理安排工期节点，助力项目完美履约，为祖国母亲献上海外人特殊的生日礼物。</p>','2022-01-05 20:49:04','Normal'),('1478710695514148865',2,'雄安容东管廊项目荣获河北省三星级智慧工地示范工程','（张新生  讯）2020年11月第二批河北省创建智慧工地示范工程评选结果正式出炉，雄安容东管廊项目以BIM技术为基础，结合5G智慧工地技术应用，创下了雄安新区容东片区市政工程首个河北省三星级智慧工地示范工程（三星级为最高级）。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/2fd3f814dde2440781cbb69a8b9d0d71QQ图片20220105205106.jpg','2022-01-05 20:51:18','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>（张新生&nbsp; 讯）2020年11月第二批河北省创建智慧工地示范工程评选结果正式出炉，雄安容东管廊项目以BIM技术为基础，结合5G智慧工地技术应用，创下了雄安新区容东片区市政工程首个河北省三星级智慧工地示范工程（三星级为最高级）。</p>\n<p>项目智慧工地按照以信息集成平台为主线，以智能硬件为支撑，以5G智慧展厅为窗口、以BIM技术为辅助的建设思路，在智慧工地创建过程中，打造雄安施工现场首座5G专属基站，雄安首个在建筑工程领域内的5G专属网络，保障最优网络；雄安首次定制化专属覆盖方案满足高层作业面网络需求。运用&ldquo;一通多能四驱动&rdquo;架构采用定制化5G网络围绕人、机、料、法、环、测，研发5G智慧工地平台。</p>\n<p>达到了河北省示范工程智慧工地应用的基本要求，应用BIM技术及互联网、物联网和智能设备的集成应用，控制项19项，一般项52项；应用智慧工地技术71项；实现了工程建设期间全员、全过程、全方位的建设信息归依和管理。实现了智慧工地管理智慧化、生产智慧化、监控智慧化、服务智慧化的智慧工地总体目标。</p>\n<p>本次荣获河北省三星级智慧工地示范工程展现了项目优秀的信息化水平及先进的管理理念，进一步提升公司在智慧建造方面的技术实力，扩大公司在雄安新区的优势，为我局进一步开拓和占领市场方面起到非常大的促进作用。</p>','2022-01-05 20:51:33','Normal'),('1478711289314349057',1,'华北公司大礼路项目成功斩获2020年度北京市政基础设施结构长城杯金奖','（杨秀龙  讯）4月，北京市政工程行业协会公示了关于北京市2020年度市政基础设施长城杯工程评审结果公告（市政协会发【2021】003号），华北公司大礼路项目成功斩获2020年度北京市政基础设施公用结构长城杯金奖这一殊荣。','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/01/05/551a05b4754440e6b86368b02b0378b8QQ图片20220105205330.jpg','2022-01-05 20:53:39','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>（杨秀龙&nbsp;&nbsp;讯）4月，北京市政工程行业协会公示了关于北京市2020年度市政基础设施长城杯工程评审结果公告（市政协会发【2021】003号），华北公司大礼路项目成功斩获2020年度北京市政基础设施公用结构长城杯金奖这一殊荣。</p>\n<p>&ldquo;北京市政基础设施公用长城杯金奖&rdquo; 是作为北京市建委发起的建筑结构方面的创优活动、建设工程质量领域的最高奖，获得此奖的工程是代表着北京市建设工程质量最高水准建筑奖项。大礼路项目自建设以来以获得&ldquo;北京市政基础设施公用工程长城杯金奖&rdquo;作为质量管理目标，始终以&ldquo;追求卓越，精益求精&rdquo;的工匠精神打造土木公司在北京大兴国际机场临空经济区建设品质工程，为公司开拓市场方面大大提升公司的品牌影响力！</p>','2022-01-07 17:36:08','Normal'),('1491605050306351105',1,'今天是肯德基疯狂星期四','我本是上市公司的老总，却被坏人所害！下属弃我！股东逐我！甚至清空我的股份！我只想夺回我的公司！今天肯德基疯狂星期四，谁请我吃，待我夺回我的公司我将给予公司50%股权作为报答！','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2022/02/10/57ed03377f9b4aa7be5550475dbde77fQQ图片20220210104839.jpg','2022-02-10 10:48:51','<p><img class=\"wscnph\" src=\"data:image/jpeg;base64,\" /></p>','2022-02-10 10:52:23','Normal'),('1499001773609742337',1,'11','11','https://edu-guli-wtw.oss-cn-guangzhou.aliyuncs.com/2021/12/29/96c7b0324c154124b3302246656faa0fdsm.jpg','2022-03-02 20:40:48','<p>aa</p>','2022-03-02 20:41:00','Draft');

