/*Table structure for table `tbidder` */

DROP TABLE IF EXISTS `tbidder`;

CREATE TABLE `tbidder` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `username` varchar(100) DEFAULT NULL COMMENT '登录用户名',
  `password` varchar(32) DEFAULT NULL COMMENT '登录密码',
  `salt` varchar(36) DEFAULT NULL COMMENT '盐值',
  `contacts_name` varchar(50) DEFAULT NULL COMMENT '联系人姓名',
  `company_name` varchar(50) DEFAULT NULL COMMENT '公司名称',
  `phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `file` varchar(100) DEFAULT NULL COMMENT '公司上传的附件',
  `is_delete` int(11) DEFAULT NULL COMMENT '1-已删除 2-未删除',
  `gmt_create` datetime DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` datetime DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

